                <div class="embed-responsive embed-responsive-16by9">
                    <iframe class="embed-responsive-item" src="https://www.youtube.com/embed/zpOULjyy-n8?rel=0" allowfullscreen style={{width:"600px"}}></iframe>
                </div>
            </div>
        );
    }
}

export default About;
